      archmage_attribute_2: "Pewne doświadczenie w programowaniu i własna inicjatywa. Pomożemy ci się połapać, ale nie możemy spędzić zbyt dużo czasu na szkoleniu cię.",
      how_to_join: "Jak dołączyć",
